import React from "react";

const Products = ({ products }) => {
  return (
    products &&
    products.map((product, i) => {
      <div className="products wrapper" key={i}>
        <div>{product.name}</div>
        <div>{product.color}</div>
        <div>{product.price}</div>
      </div>;
    })
  );
};

export default Products;
